    vfs_node_t *ntp_server = vfs_open_file(vfs_root(), "/etc/ntp/server", false, false);
    if (!ntp_server)
    {
        ntp_server = vfs_open_file(vfs_root(), "/etc/ntp/server", true, true);
        if (ntp_server)
        {
